import React from 'react';
import intro from './intro.wav'

export default function Body() {
    const handleIntro=()=>{
        const sound = new Audio(intro);
        sound.play();
    }
  return <div>
      <div className="bodyContainer">
          <button className="introButton" onClick={handleIntro}>PLAY</button>
      </div>
  </div>;
}
